import { useRef } from "react";

const Canvas = () => {
    const canvasRef = useRef<HTMLCanvasElement>(null);
    if (canvasRef.current) {
        return <canvas ref={canvasRef} />;
    } else {
        return <div>Canvas not supported</div>;
    }
};

export default Canvas;
